# Tangut 西夏文polyhedron四角輸入法
#
# 使用說明
# 本輸入法改編自李範文《夏漢字典》的四角号碼索引，但進行了較大改動
# 如將丨、丿分開，十、乂分開，亅不算丨而算折，等等，以減少重碼
# 
# 具體方案如下：
# 每一個字有6碼，其中第1、2、3、4碼依次爲左上、右上、左下、右下，
# 第5碼爲左下角右鄰，第6碼爲右下角左鄰。
# 
# 1 橫：一、乚（右下）
# 2 豎：丨、接近丨的撇
# 3 撇：丿（明確的撇）
# 4 直交：十（必須有一筆爲正）、匕（右上）
# 5 雙交：艹、キ（不論橫豎、正斜）
# 6 多交：卅卌（不論橫豎，要求一條直線上的交點）
# 7 折：（只要折角向外）卯（左上）、>（右下）、巾（左上）、力（右下）
# 8 斜交：乂（兩筆都要是斜的）、力（左下）
# 9 點捺：丶、人（右）、亠（上）
# 0 補位：位置已被之前的碼包括時算0
#
# 一個形狀多碼可取時，按7（折）-6（多交）-5（雙交）-4/8（單交）-單筆-0的順序取碼
# 5（雙交）橫豎均可取時，取豎的
# 4-8（折、交）可涵蓋直筆至頂端，但不可涵蓋折、彎筆及交點
# 右上角（第2碼）有多形可能取時，看疊壓順序，取靠外的，如𘠙取9不取1，𗂮取1不取2，但爲減少重碼，規定𗢭取4不取7，𗾆、𘊏、𗫵不取3而取8、5、9
# 
# 具體用例說明：
# 𘂪	938000	左上點-9、右上撇-3、左下叉-8、右下及最後兩位已被叉算入，塡0
# 𘚢	148120	左上橫-1、右上直交-4（匕形作爲特例算交）、左下叉-8（內形突出的“贝”形字3、4碼用內形，5、6碼左右的豎也可用）、右下匕-1、下補左豎-2、下補右無-0（匕的左下角在第5、6碼不算，在第3碼算7）
# 𘒮	528079	左上雙交（豎上一正一斜）-5、右上豎-2、左下力-8（不涵蓋右下角拐彎）、右下無-0、下補左折-7、下補右點-9
# 𗊥	773576	左上折-7、右上折-7（不到兩個與豎的交叉點）、左下撇-3（折向內的不能算7）、右下雙交-5、左下補折-7、右下補多交-6（一豎三交叉點）
# 𗃻	737151	左上折-7、右上撇-3、左下折-7（一筆的兩個折分別算）、右下乚-1、下補左雙交-5（先算右下角左邊的豎，再加左右穿出的一橫及右邊的豎）、下補右橫-1（不須在最外，不交叉且下面無其它筆畫就計）
# 𗷾	185850	左上橫-1、右上叉-8（不取3）、左下雙交-5（算豎的）、右下叉-8、下補左雙交-5（還有一個豎帶兩交點）、下補右無-0
# 𗥼	338767	左上撇-3、右上撇-3、左下叉-8、右下> -7、下補左多交-6、下補右力-7
